u043d \u043a \u043a\u0430\u0437\u043d\u0438 \u0437\u0430 \u043a\u043d\u0438\u0433\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%83%D1%82%D0%B5%D1%88%D0%B5%D1%81%D1%82%D0%B2%D0%B8%D0%B5_%D0%B8%D0%B7_%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3%D0%B0_%D0%B2_%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D1%83\" title=\"\u041f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0438\u0435 \u0438\u0437 \u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0430 \u0432 \u041c\u043e\u0441\u043a\u0432\u0443\">\u00ab\u041f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0438\u0435 \u0438\u0437 \u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0430 \u0432 \u041c\u043e\u0441\u043a\u0432\u0443\u00bb<\/a>.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1806_%D0%B3%D0%BE%D0%B4\" title=\"1806 \u0433\u043e\u0434\">1806 \u0433\u043e\u0434<\/a>&#160;\u2014 \u041a\u043e\u043d\u0435\u0446 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B2%D1%8F%D1%89%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D0%A0%D0%B8%D0%BC%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0421\u0432\u044f\u0449\u0435\u043d\u043d\u0430\u044f \u0420\u0438\u043c\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0421\u0432\u044f\u0449\u0435\u043d\u043d\u043e\u0439 \u0420\u0438\u043c\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a> \u043f\u043e\u0441\u043b\u0435 \u043e\u0442\u043a\u0430\u0437\u0430 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86_II\" title=\"\u0424\u0440\u0430\u043d\u0446 II\">\u0424\u0440\u0430\u043d\u0446\u0430 II<\/a> (Franz II. Joseph Karl) \u043e\u0442 \u0433\u0435\u0440\u043c\u0430\u043d\u0441\u043a\u043e\u0439 \u043a\u043e\u0440\u043e\u043d\u044b \u0438 \u043b\u0438\u043a\u0432\u0438\u0434\u0430\u0446\u0438\u0438 \u0438\u043c\u043f\u0435\u0440\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1817_%D0%B3%D0%BE%D0%B4\" title=\"1817 \u0433\u043e\u0434\">1817 \u0433\u043e\u0434<\/a>&#160;\u2014 \u041d\u0430\u0447\u0430\u043b\u0430 \u0434\u0435\u0439\u0441\u0442\u0432\u043e\u0432\u0430\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%B6%D0%B5%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D1%8F%D1%80%D0%BC%D0%B0%D1%80%D0%BA%D0%B0\" title=\"\u041d\u0438\u0436\u0435\u0433\u043e\u0440\u043e\u0434\u0441\u043a\u0430\u044f \u044f\u0440\u043c\u0430\u0440\u043a\u0430\">\u041d\u0438\u0436\u0435\u0433\u043e\u0440\u043e\u0434\u0441\u043a\u0430\u044f \u044f\u0440\u043c\u0430\u0440\u043a\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1825_%D0%B3%D0%BE%D0%B4\" title=\"1825 \u0433\u043e\u0434\">1825 \u0433\u043e\u0434<\/a>&#160;\u2014 \u041a\u043e\u043d\u0433\u0440\u0435\u0441\u0441 \u0432 \u0433\u043e\u0440\u043e\u0434\u0435 \u0427\u0443\u043a\u0438\u0441\u0430\u043a\u0435 (\u0441\u043e\u0432\u0440. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83%D0%BA%D1%80%D0%B5_(%D0%B3%D0%BE%D1%80%D0%BE%D0%B4)\" title=\"\u0421\u0443\u043a\u0440\u0435 (\u0433\u043e\u0440\u043e\u0434)\">\u0421\u0443\u043a\u0440\u0435<\/a>) \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u043e \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u0438 \u0412\u0435\u0440\u0445\u043d\u0435\u0433\u043e \u041f\u0435\u0440\u0443, \u043d\u0430\u0437\u0432\u0430\u043d\u043d\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D0%B8%D0%B2%D0%B8%D1%8F\" title=\"\u0411\u043e\u043b\u0438\u0432\u0438\u044f\">\u0411\u043e\u043b\u0438\u0432\u0438\u0435\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1828_%D0%B3%D0%BE%D0%B4\" title=\"1828 \u0433\u043e\u0434\">1828 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0412 \u041a\u0430\u043d\u0430\u0434\u0435 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0430\u0441\u044c \u043f\u0435\u0440\u0432\u0430\u044f \u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u0430\u044f \u0440\u0435\u0433\u0430\u0442\u0430, \u0441\u0430\u043c\u043e\u0435 \u0441\u0442\u0430\u0440\u043e\u0435 \u0441\u043f\u043e\u0440\u0442\u0438\u0432\u043d\u043e\u0435 \u0441\u043e\u0440\u0435\u0432\u043d\u043e\u0432\u0430\u043d\u0438\u0435 \u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0410\u043c\u0435\u0440\u0438\u043a\u0438, \u0434\u043e\u0448\u0435\u0434\u0448\u0435\u0435 \u0434\u043e \u043d\u0430\u0448\u0438\u0445 \u0434\u043d\u0435\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1851_%D0%B3%D0%BE%D0%B4\" title=\"1851 \u0433\u043e\u0434\">1851 \u0433\u043e\u0434<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%82%D0%B0%D0%B9\" class=\"mw-redirect\" title=\"\u041a\u0438\u0442\u0430\u0439\">\u041a\u0438\u0442\u0430\u0439<\/a> \u0438 \u0420\u043e\u0441\u0441\u0438\u044f \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b\u0438 \u041a\u0443\u043b\u044c\u0434\u0436\u0438\u043d\u0441\u043a\u0438\u0439 \u0442\u043e\u0440\u0433\u043e\u0432\u044b\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440, \u043f\u043e\u043b\u043e\u0436\u0438\u0432\u0448\u0438\u0439 \u043d\u0430\u0447\u0430\u043b\u043e \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u043c \u0442\u043e\u0440\u0433\u043e\u0432\u044b\u043c \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f\u043c \u044d\u0442\u0438\u0445 \u0441\u0442\u0440\u0430\u043d.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1866_%D0%B3%D0%BE%D0%B4\" title=\"1866 \u0433\u043e\u0434\">1866 \u0433\u043e\u0434<\/a>&#160;\u2014 \u041e\u0441\u0442\u0440\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D0%BD%D0%BA%D1%83%D0%B2%D0%B5%D1%80_(%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B2)\" title=\"\u0412\u0430\u043d\u043a\u0443\u0432\u0435\u0440 (\u043e\u0441\u0442\u0440\u043e\u0432)\">\u0412\u0430\u043d\u043a\u0443\u0432\u0435\u0440<\/a> \u0432\u043a\u043b\u044e\u0447\u0451\u043d \u0432 \u0441\u043e\u0441\u0442\u0430\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%9A%D0%BE%D0%BB%D1%83%D0%BC%D0%B1%D0%B8%D1%8F\" title=\"\u0411\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0430\u044f \u041a\u043e\u043b\u0443\u043c\u0431\u0438\u044f\">\u0411\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u043e\u0439 \u041a\u043e\u043b\u0443\u043c\u0431\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1888_%D0%B3%D0%BE%D0%B4\" title=\"1888 \u0433\u043e\u0434\">1888 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0412 \u0422\u044f\u0440\u043b\u0435\u0432\u043e (\u043f\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" class=\"mw-redirect\" title=\"\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u043e\u043c<\/a>) \u043f\u0440\u043e\u0432\u0435\u0434\u0435\u043d\u044b \u0441\u043e\u0440\u0435\u0432\u043d\u043e\u0432\u0430\u043d\u0438\u044f \u043f\u043e \u0431\u0435\u0433\u0443, \u043f\u043e\u043b\u043e\u0436\u0438\u0432\u0448\u0438\u0435 \u043d\u0430\u0447\u0430\u043b\u043e \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u043b\u0451\u0433\u043a\u043e\u0439 \u0430\u0442\u043b\u0435\u0442\u0438\u043a\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1889_%D0%B3%D0%BE%D0%B4\" title=\"1889 \u0433\u043e\u0434\">1889 \u0433\u043e\u0434<\/a><ul><li>\u041f\u0440\u043e\u0432\u0435\u0434\u0451\u043d \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0439 \u0431\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BA%D1%81\" title=\"\u0411\u043e\u043a\u0441\">\u0431\u043e\u043a\u0441\u0451\u0440\u043e\u0432<\/a> \u0431\u0435\u0437 \u043f\u0435\u0440\u0447\u0430\u0442\u043e\u043a.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\">\u041b\u043e\u043d\u0434\u043e\u043d\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u0442 \u043e\u0442\u0435\u043b\u044c \u00ab\u0421\u0430\u0432\u043e\u0439\u00bb, \u043f\u0435\u0440\u0432\u0430\u044f \u0432 \u043c\u0438\u0440\u0435 \u0433\u043e\u0441\u0442\u0438\u043d\u0438\u0446\u0430 \u0441 \u0432\u0430\u043d\u043d\u043e\u0439 \u0432 \u043a\u0430\u0436\u0434\u043e\u043c \u043d\u043e\u043c\u0435\u0440\u0435.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1890_%D0%B3%D0%BE%D0%B4\" title=\"1890 \u0433\u043e\u0434\">1890 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0423\u0431\u0438\u0439\u0446\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B5%D0%BC%D0%BC%D0%BB%D0%B5%D1%80,_%D0%A3%D0%B8%D0%BB%D1%8C%D1%8F%D0%BC\" title=\"\u041a\u0435\u043c\u043c\u043b\u0435\u0440, \u0423\u0438\u043b\u044c\u044f\u043c\">\u0423\u0438\u043b\u044c\u044f\u043c \u041a\u0435\u043c\u043c\u043b\u0435\u0440<\/a> (William Kemmler) \u0441\u0442\u0430\u043b \u043f\u0435\u0440\u0432\u044b\u043c \u043a\u0430\u0437\u043d\u0451\u043d\u043d\u044b\u043c \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D1%82%D1%83%D0%BB\" title=\"\u042d\u043b\u0435\u043a\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0441\u0442\u0443\u043b\">\u044d\u043b\u0435\u043a\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u043e\u043c \u0441\u0442\u0443\u043b\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1893_%D0%B3%D0%BE%D0%B4\" title=\"1893 \u0433\u043e\u0434\">1893 \u0433\u043e\u0434<\/a><ul><li>\u0421 6 \u043f\u043e 12 \u0430\u0432\u0433\u0443\u0441\u0442\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D1%8E%D1%80%D0%B8%D1%85\" title=\"\u0426\u044e\u0440\u0438\u0445\">\u0426\u044e\u0440\u0438\u0445\u0435<\/a> \u043f\u0440\u043e\u0448\u0451\u043b \u0442\u0440\u0435\u0442\u0438\