ers<\/a> \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u043b\u0430 \u043d\u0430 \u0441\u0443\u0434 \u0437\u0440\u0438\u0442\u0435\u043b\u0435\u0439 \u0444\u0438\u043b\u044c\u043c \u00ab\u0414\u043e\u043d \u0416\u0443\u0430\u043d\u00bb \u0441\u043e \u0437\u0432\u0443\u043a\u043e\u0432\u043e\u0439 \u0441\u0438\u0441\u0442\u0435\u043c\u043e\u0439 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D1%82%D0%B0%D1%84%D0%BE%D0%BD\" class=\"mw-redirect\" title=\"\u0412\u0438\u0442\u0430\u0444\u043e\u043d\">\u0412\u0438\u0442\u0430\u0444\u043e\u043d<\/a>\u00bb, \u043f\u043e\u0437\u0432\u043e\u043b\u044f\u0432\u0448\u0435\u0439 \u0441\u0438\u043d\u0445\u0440\u043e\u043d\u0438\u0437\u0438\u0440\u043e\u0432\u0430\u0442\u044c \u043c\u0443\u0437\u044b\u043a\u0430\u043b\u044c\u043d\u043e\u0435 \u0441\u043e\u043f\u0440\u043e\u0432\u043e\u0436\u0434\u0435\u043d\u0438\u0435 \u0441 \u043a\u0438\u043d\u043e\u043a\u0430\u0434\u0440\u0430\u043c\u0438.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1929_%D0%B3%D0%BE%D0%B4\" title=\"1929 \u0433\u043e\u0434\">1929 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B8%D1%81%D1%82%D0%BE%D0%BB%D1%8C\" title=\"\u0411\u0440\u0438\u0441\u0442\u043e\u043b\u044c\">\u0411\u0440\u0438\u0441\u0442\u043e\u043b\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u043b\u0438\u0441\u044c \u043f\u0435\u0440\u0432\u044b\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a> \u043a\u0443\u0440\u0441\u044b \u0430\u0432\u0442\u043e\u0432\u043e\u0436\u0434\u0435\u043d\u0438\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1932_%D0%B3%D0%BE%D0%B4\" title=\"1932 \u0433\u043e\u0434\">1932 \u0433\u043e\u04